    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Ellicott Slough NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Ellicott Slough NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, the CCP process, a description of Refuge resources,
    current management programs, the management direction, and strategies for plan implementation.
    Key planning issues include: public trespass, illegal fishing, traffic and amphibian
    mortality, invasive plants, agriculture, drought, fungus outbreaks, mosquito control,
    predator control, and climate change.",nt"license_title": "License Not Specified",nt"extras":
